import React from 'react';
import './Filters.css';

function Filters() {
  return (
    <div className="filters">
      <select className="filter-select"><option>Ціна</option></select>
      <select className="filter-select"><option>Кількість відвідувачів</option></select>
      <select className="filter-select"><option>Кількість номерів</option></select>
      <button className="apply-button">Підтвердити</button>
    </div>
  );
}

export default Filters;
